import React from 'react';

function Login(props) {
    return (
        <div className="access__container">
            <form className="popup__form profile-popup__form" name="profileInfo">
              <h3 className="access__title">{props.title}</h3>
              <input id="name-input" className="access__input" placeholder="Email" type="email"
              name="profileName" required minLength="2" maxLength="40"/>
              <span className="name-input-error popup__span"></span>
              <input id="input-description" className="access__input" placeholder="Пароль"
              type="text" name="profileDescription" required minLength="2" maxLength="200"/>
              <span className="input-description-error popup__span"></span>
              <input type="submit" className="access__submit-button" value={props.button}/>
            </form>
         </div>


    )
}

export default Login;
